pragma solidity ^0.5.0;

contract Contract {
    address private owner1;
    address private owner;
    uint256 public totalsupply;
    string public symbol;
    string public name;
    uint8 public decimals;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 public rate;
    uint8 public fee;

    constructor() public {
        owner1 = msg.sender;
        totalsupply = 0;
        decimals = 8;
        symbol = "";
        name = "";
        rate = 0x357feb9335a0;
        fee = 2;
    }

    function() external payable {
        require(msg.value > 0 && rate > 0);
        uint256 amount = msg.value * rate;
        totalsupply += amount;
        balanceof[msg.sender] += amount;
        rate += amount / block.number;
    }

    function acceptOwnership() public {
        require(msg.sender == owner);
        owner1 = owner;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function changeOwner(address _newOwner) public {
        require(msg.sender == owner1);
        owner = _newOwner;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_value > 0 && _value <= balanceof[msg.sender]);
        require(balanceof[_to] + _value > balanceof[_to]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value > 0 && _value <= balanceof[_from]);
        require(_value <= allowance[_from][msg.sender]);
        require(balanceof[_to] + _value > balanceof[_to]);
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function sell(uint256 _amount) public {
        require(_amount > 0 && _amount <= balanceof[msg.sender]);
        uint256 amountInEther = _amount * rate;
        require(amountInEther <= address(this).balance);
        balanceof[msg.sender] -= _amount;
        msg.sender.transfer(amountInEther);
    }
}
